"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[711],{711:e=>{e.exports=JSON.parse('{"lessonId":"B1_U101","title":"\u0423\u0440\u043e\u043a 101: \u041d\u0430\u0440\u0435\u0447\u0438\u044f \u0432\u0440\u0435\u043c\u0435\u043d\u0438 (1)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041d\u0430\u0440\u0435\u0447\u0438\u044f \u0432\u0440\u0435\u043c\u0435\u043d\u0438","content":[{"text":"<strong>Anteayer, ayer, anoche...</strong> \u2014 \u044d\u0442\u043e \u043d\u0430\u0440\u0435\u0447\u0438\u044f \u0432\u0440\u0435\u043c\u0435\u043d\u0438. \u041e\u043d\u0438 \u0434\u0430\u044e\u0442 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e \u043e \u0442\u043e\u043c, \u043a\u043e\u0433\u0434\u0430 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435, \u0438 \u043e\u0442\u0432\u0435\u0447\u0430\u044e\u0442 \u043d\u0430 \u0432\u043e\u043f\u0440\u043e\u0441 `\xbfcu\xe1ndo?`."}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435","content":[{"list":["<strong>- entonces, luego, despu\xe9s</strong><br><i>`entonces` (= en ese momento): Le pregunt\xe9 por Paula y <strong>entonces</strong> me cont\xf3 toda la historia.</i><br><i>`luego` (=despu\xe9s de, m\xe1s tarde) \u0438 `despu\xe9s` (=m\xe1s tarde) \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f \u043a \u043c\u043e\u043c\u0435\u043d\u0442\u0443, \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u043c\u0443 \u0437\u0430 \u043c\u043e\u043c\u0435\u043d\u0442\u043e\u043c \u0440\u0435\u0447\u0438.<br>Ahora tengo clase. Nos vemos <strong>luego</strong>. / Me voy. <strong>Despu\xe9s</strong> te llamo.</i>","<strong>- pronto, temprano, tarde</strong><br><i>`pronto` = en poco tiempo, poco tiempo despu\xe9s: Hemos corrido y hemos llegado <strong>pronto</strong>.</i><br><i>`temprano` = a primeras horas del d\xeda o de la noche: Abel se levanta <strong>temprano</strong>, a las seis.</i><br><i>`tarde` = a \xfaltimas horas del d\xeda o de la noche: Ayer cenamos muy <strong>tarde</strong>, a las doce.</i>"]},{"text":"<strong>\u0421\u0440\u0430\u0432\u043d\u0438\u0442\u0435 (Compare):</strong><br><i>\u2013\xbfSe ha ido Mar\xeda? \u2013S\xed, pero <strong>vuelve pronto</strong>. (poco tiempo despu\xe9s)<br>\u2013Mam\xe1, nos vamos. \u2013<strong>Volved temprano</strong>. (a primera hora de la noche)</i>"},{"text":"<strong>ATENCI\xd3N:</strong><br>\u041a\u043e\u0433\u0434\u0430 `cuando, ahora, hoy...` \u0441\u0442\u043e\u044f\u0442 \u0432 \u043d\u0430\u0447\u0430\u043b\u0435 \u0444\u0440\u0430\u0437\u044b, \u043f\u043e\u0434\u043b\u0435\u0436\u0430\u0449\u0435\u0435 \u043e\u0431\u044b\u0447\u043d\u043e \u0438\u0434\u0435\u0442 \u043f\u043e\u0441\u043b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u0430.<br><i>Ayer <strong>Pablo lleg\xf3</strong>. \u2192 Ayer <strong>lleg\xf3 Pablo</strong>.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 101.1: \u0417\u0430\u043c\u0435\u043d\u0438\u0442\u0435 \u043f\u043e\u0434\u0447\u0435\u0440\u043a\u043d\u0443\u0442\u044b\u0435 \u0441\u043b\u043e\u0432\u0430 \u043d\u0430\u0440\u0435\u0447\u0438\u044f\u043c\u0438 \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430","content":[{"text":"<strong>\u0421\u043b\u043e\u0432\u0430 \u0434\u043b\u044f \u0441\u043f\u0440\u0430\u0432\u043e\u043a:</strong> anoche, anteayer, ayer, hoy, ma\xf1ana, pasado ma\xf1ana"}],"tasks":[{"id":"u101_1_1","sentence":"1. <u>El lunes 12</u> voy al m\xe9dico. \u2192 ___ voy al m\xe9dico.","answer":"Pasado ma\xf1ana"},{"id":"u101_1_2","sentence":"2. <u>El s\xe1bado 10</u> he quedado con Elo\xedsa. \u2192 ___ he quedado con Elo\xedsa.","answer":"Hoy"},{"id":"u101_1_3","sentence":"3. <u>El jueves 8</u> estuve en Le\xf3n. \u2192 ___ estuve en Le\xf3n.","answer":"Anteayer"},{"id":"u101_1_4","sentence":"4. <u>El domingo 11</u> vamos a hacer una merienda en el campo. \u2192 ___ vamos a hacer una merienda en el campo.","answer":"Ma\xf1ana"},{"id":"u101_1_5","sentence":"5. <u>El viernes 9 por la noche</u> salimos a cenar con unos amigos. \u2192 ___ salimos a cenar con unos amigos.","answer":"Ayer por la noche"},{"id":"u101_1_6","sentence":"6. <u>El viernes 9</u> recib\xed una postal de Miguel. \u2192 ___ recib\xed una postal de Miguel.","answer":"Ayer"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 101.2: \u0420\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435 \u0441\u043b\u043e\u0432\u0430 \u0438 \u0441\u043e\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u0444\u0440\u0430\u0437\u044b","tasks":[{"id":"u101_2_1","sentence":"1. pasado ma\xf1ana / Emma / se marcha \u2192 ___.","answer":"Pasado ma\xf1ana se marcha Emma"},{"id":"u101_2_2","sentence":"2. ma\xf1ana / el jefe / en la oficina / no estar\xe1 \u2192 ___.","answer":"Ma\xf1ana no estar\xe1 el jefe en la oficina"},{"id":"u101_2_3","sentence":"3. ayer / Olga / me llam\xf3 \u2192 ___.","answer":"Ayer me llam\xf3 Olga"},{"id":"u101_2_4","sentence":"4. pasado ma\xf1ana / mis padres / llegan \u2192 ___.","answer":"Pasado ma\xf1ana llegan mis padres"},{"id":"u101_2_5","sentence":"5. ahora / Concha / no est\xe1 \u2192 ___.","answer":"Ahora no est\xe1 Concha"},{"id":"u101_2_6","sentence":"6. y / entonces / el espect\xe1culo / sonaron unas trompetas / empez\xf3 \u2192 ___.","answer":"Y entonces sonaron unas trompetas y empez\xf3 el espect\xe1culo"}]},{"type":"MultipleChoice","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 101.3: \u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0443\u044e \u0444\u043e\u0440\u043c\u0443","tasks":[{"id":"u101_3_1","sentence":"1. No te preocupes. Estoy segura de que nos veremos (temprano/pronto).","options":["temprano","pronto"],"correctOption":"pronto"},{"id":"u101_3_2","sentence":"2. Ma\xf1ana nos tenemos que levantar (temprano/tarde). El avi\xf3n sale a las siete.","options":["temprano","tarde"],"correctOption":"temprano"},{"id":"u101_3_3","sentence":"3. Primero iremos a Mendoza y (entonces/despu\xe9s) a Bariloche.","options":["entonces","despu\xe9s"],"correctOption":"despu\xe9s"},{"id":"u101_3_4","sentence":"4. Llamamos al timbre y (entonces/despu\xe9s) sali\xf3 el marido de Tere.","options":["entonces","despu\xe9s"],"correctOption":"entonces"},{"id":"u101_3_5","sentence":"5. Estoy acabando un trabajo, pero si quieres nos vemos (entonces/luego).","options":["entonces","luego"],"correctOption":"luego"},{"id":"u101_3_6","sentence":"6. Hab\xe9is llegado (tarde/temprano). La pel\xedcula ya ha empezado.","options":["tarde","temprano"],"correctOption":"tarde"},{"id":"u101_3_7","sentence":"7. Daos prisa. Los invitados van a llegar (temprano/pronto).","options":["temprano","pronto"],"correctOption":"pronto"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 101.4: \u0417\u0430\u043c\u0435\u043d\u0438\u0442\u0435 \u043f\u043e\u0434\u0447\u0435\u0440\u043a\u043d\u0443\u0442\u044b\u0435 \u0441\u043b\u043e\u0432\u0430 \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0438 \u0441\u0438\u043d\u043e\u043d\u0438\u043c\u0430\u043c\u0438","tasks":[{"id":"u101_4_1","sentence":"1. Tienen que hacer el proyecto <u>en poco tiempo</u>. \u2192 ___","answer":"pronto"},{"id":"u101_4_2","sentence":"2. Ma\xf1ana nos tenemos que levantar <u>a primera hora del d\xeda</u>. \u2192 ___","answer":"temprano"},{"id":"u101_4_3","sentence":"3. Estaba hablando con Josefina y <u>en ese momento</u> lleg\xf3 Roberto. \u2192 ___","answer":"entonces"},{"id":"u101_4_4","sentence":"4. Ahora tengo trabajo, te llamar\xe9 <u>despu\xe9s del trabajo</u>. \u2192 ___","answer":"luego"},{"id":"u101_4_5","sentence":"5. Era <u>una hora avanzada de la noche</u>, pero llamamos a una ambulancia y vino <u>en muy poco tiempo</u>. \u2192 ___","answer":"tarde, pronto"},{"id":"u101_4_6","sentence":"6. Hoy quiero cenar y acostarme <u>antes de lo normal</u>. Estoy cansado. \u2192 ___","answer":"temprano"},{"id":"u101_4_7","sentence":"7. Ahora no tenemos hambre. Comeremos <u>m\xe1s tarde</u>. \u2192 ___","answer":"despu\xe9s"},{"id":"u101_4_8","sentence":"8. Apagaron las luces y <u>en ese momento</u> se oy\xf3 una voz. \u2192 ___","answer":"entonces"}]}]}')}}]);